        setCreate(true)
    }


if (!token) {
    return <Redirect to='/' />
}

return (
    <div className='contact'>
    { create? 
        <p> hi </p>
    :

        <button className='btn btn-background-circle'
        onClick={Create}
            >
            Create Contact
        </button>
    }
    </div>
);
}
export default Contacts;
